-- ----------------------------
-- Table structure for attachment_chunks
-- ----------------------------
DROP TABLE IF EXISTS `attachment_chunks`;
CREATE TABLE `attachment_chunks`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `aid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'AttachmentFile ID',
  `index` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '第几块',
  `start` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '起始字节',
  `end` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '结束字节',
  `basename` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '存储的文件名(包含扩展名)',
  `path` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '存储文件路径',
  `hash` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '文件MD5',
  `size` int(10) UNSIGNED NOT NULL COMMENT '文件大小',
  `created_at` timestamp(0) NULL DEFAULT NULL,
  `updated_at` timestamp(0) NULL DEFAULT NULL,
  `deleted_at` timestamp(0) NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `attachment_chunks_aid_foreign`(`aid`) USING BTREE,
  INDEX `attachment_chunks_index_index`(`index`) USING BTREE,
  INDEX `attachment_chunks_start_index`(`start`) USING BTREE,
  INDEX `attachment_chunks_end_index`(`end`) USING BTREE,
  INDEX `attachment_chunks_hash_index`(`hash`) USING BTREE,
  INDEX `attachment_chunks_size_index`(`size`) USING BTREE,
  CONSTRAINT `attachment_chunks_aid_foreign` FOREIGN KEY (`aid`) REFERENCES `attachments` (`id`) ON DELETE CASCADE ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for attachment_files
-- ----------------------------
DROP TABLE IF EXISTS `attachment_files`;
CREATE TABLE `attachment_files`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `basename` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '存储的文件名',
  `path` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '存储文件路径',
  `hash` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '文件MD5',
  `size` int(10) UNSIGNED NOT NULL COMMENT '文件大小',
  `cdn_at` timestamp(0) NULL DEFAULT NULL COMMENT '上传CDN的时间',
  `created_at` timestamp(0) NULL DEFAULT NULL,
  `updated_at` timestamp(0) NULL DEFAULT NULL,
  `deleted_at` timestamp(0) NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `attachment_files_hash_size_unique`(`hash`, `size`) USING BTREE,
  INDEX `attachment_files_hash_index`(`hash`) USING BTREE,
  INDEX `attachment_files_size_index`(`size`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci ROW_FORMAT = Dynamic;

