-- ----------------------------
-- Table structure for attachments
-- ----------------------------
DROP TABLE IF EXISTS `attachments`;
CREATE TABLE `attachments`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `afid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'AttachmentFile ID',
  `uuid` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '上传的uuid',
  `chunk_count` int(10) UNSIGNED NOT NULL DEFAULT 1 COMMENT '块数',
  `original_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '原始文件名',
  `filename` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '新文件名(下载用)',
  `ext` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '文件扩展名',
  `extra` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '其它内容',
  `uid` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '用户ID',
  `created_at` timestamp(0) NULL DEFAULT NULL,
  `updated_at` timestamp(0) NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `attachments_uuid_unique`(`uuid`) USING BTREE,
  INDEX `attachments_chunk_count_index`(`chunk_count`) USING BTREE,
  INDEX `attachments_ext_index`(`ext`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci ROW_FORMAT = Dynamic;

